const Search = () => {
  const [term, setTerm] = useState("");

  console.log("i run with every render");

  useEffect(() => {
    console.log("I RUN AFTER EVERY RENDER AND AFTER INITIAL ");
  }, [term]);

  return (
    <div>
      <div className="ui form">
        <div className="field">
          <label>Enter Search Term</label>
          <input value={term} className="input" onChange={(e) => setTerm()} />
        </div>
      </div>
    </div>
  );
};

export default Search;
